import React from "react";
import { Heading } from "../common/Heading";
import { about } from "../data/datas";
import Typewriter from "typewriter-effect";

const score = [
  {
    score1: "98%",
    score2: "99%",
    score3: "100%",
  },
];

export const Score = () => {
  return (
    <>
      <section className="score">
        <div className="container2 flex">
          {about.map((val, index) => (
            <React.Fragment key={index}>
              <div className="left" data-aos="fade-down-right">
                <img src={val.cover} alt="" />
              </div>
              <div className="right with-score" data-aos="fade-down-left">
                <div className="text">
                  <Heading title="Score" />
                  <p>{val.desc}</p>
                  <p>{val.desc1}</p>
                  <p>{val.desc2}</p>
                </div>
                <div className="score-typewriter">
                  <Typewriter
                    options={{
                      strings: [score[0].score1, score[0].score2, score[0].score3],
                      autoStart: true,
                      loop: true,
                    }}
                  />
                </div>
              </div>
            </React.Fragment>
          ))}
        </div>
      </section>
    </>
  );
};

export default Score;
